import moment from 'moment';
import RNHTMLtoPDF from 'react-native-html-to-pdf';

const GenerateAllVaultsFilePDF = async (fingerPrints) => {
  try {
    const bsms = fingerPrints
      .map(
        (keys, index) => `<p>
        Vault Name: ${keys.name}
        <br>
        <br>
        Wallet Configuration Text:<br>
        ${keys.file}
        <br>
        <br>
      </p>
<img width="500" height="500" src="https://api.qrserver.com/v1/create-qr-code/?size=500&data=${
          keys.file
        }" alt="QR Code">
<br>
<br>
<p>File Details: File created on: ${moment().format('DD/MM/YYYY')}<br><br></p>
<p class="dashed-line"/>
<p>
<br></p>
<p>
      `
      )
      .join('');
    const html = `
    <!DOCTYPE html>
    <html lang="en">
    <style>
* {
 font-family: 'Fira Sans', sans-serif;
}
body {
background-color: #fff8ed;
padding: 25px;
}
p {
  font-size: 1.6em;
  font-family: 'Fira Sans', sans-serif;
}
h1 {
   font-size: 3.5em;
   text-align: center;
   color: rgba(6,77,65,1);
  }
 img {
  display: block;
  margin-left: auto;
  margin-right: auto;
  max-width: 100%;
  height: 350;
  margin-top: 20px
  }
  .content {
     padding: 20px;
     background-color: #fff8ed;
 }
  .dashed-line {
    border-bottom: 1px dashed black; /* Adjust width and color as needed */
  }
</style>
    <head>
        <meta charset="UTF-8">
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
    </head>
    <body>
      <img  height="200" src="data:image/png;base64,"/>

      <h1>Your Wallet Configurations</h1> 

      <div class="content">
      <p>Dear Recipient, 
      <br>
      <br>
      This document includes all your Wallet Configurations (aka Output Descriptors or BSMS files)*. To recreate your wallet on a multisig app like Keeper or Sparrow**, copy the text between the dotted lines in the Wallet Configuration Text section, and paste it in the appropriate area of the app. You can also scan the QR code of the desired vault to recreate it. 
      <br>
      <br>
      </p>
      

      ${bsms}

      <p>
      <br>
      This document is generated by the Bitcoin Keeper app. Need help? Reach out to us via the in-app chat support called Keeper Concierge. For more details visit: www.bitcoinkeeper.app.   

* Wallet configuration files standardize multi-signature setups, ensuring secure and interoperable configurations with public keys and derivation paths. This ensures that you do not have to rely on a single bitcoin wallet to create and use a multisig wallet. 
** Keeper and Sparrow are bitcoin wallets that allow you to create wallets called multisig wallets (In Keeper these are called Vaults). Multisig wallets, as the name suggests require multiple signatures to sign a single bitcoin transaction.
      </p>
</div>
    </body>
    </html>
    
      `;
    const options = {
      html,
      fileName: 'Vault-Configuration}',
      directory: 'Documents',
      base64: true,
    };
    const file = await RNHTMLtoPDF.convert(options);
    return file.filePath;
  } catch (error: any) {
    return error;
  }
};

export default GenerateAllVaultsFilePDF;
